import React, { Component } from "react";

import {
    Badge,
    Card,
    CardHeader,
    CardBody,
    Col,
    Media,
    Table,
    Container,

    Row,
} from "reactstrap";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import $ from 'jquery'; 
// const [disable,setDisable]=  useState(true);
var data = [];
const hello = (prop) => {
    data = prop;
    console.log(prop)
};
var sDate = null;
var eDate = null;
const startDate = (e) => {
    let date = new Date(e);
    var year = date.getFullYear();
    var month = date.getMonth() + 1;
    var day = date.getDate();
    if (day < 10) {
        day = 0 + "" + day;
    }
    if (month < 10) {
        month = 0 + "" + month;
    }

    sDate = year + '-' + month + '-' + day;
    console.log(sDate);
}


const endDate = (e) => {
    let date = new Date(e);
    var year = date.getFullYear();
    var month = date.getMonth() + 1;
    var day = date.getDate();
    if (day < 10) {
        day = 0 + "" + day;
    }
    if (month < 10) {
        month = 0 + "" + month;
    }
    eDate = year + '-' + month + '-' + day;

    console.log(eDate);
}
const rows = [];

function formatDate(dateString) {
    let date = new Date(dateString);
    var year = date.getFullYear();
    var month = date.getMonth() + 1;
    var day = date.getDate();
    if (day < 10) {
        day = 0 + "" + day;
    }
    if (month < 10) {
        month = 0 + "" + month;
    }
    return year + '-' + month + '-' + day;

}

export default class Recharge extends Component {
    state = {
        users: [],
        isLoading: false,
        errorMsg: ''
    };


    constructor(props) {
        super(props);
        this.state = ({
            sdate: '',
            edate: '',
            data:[]
        })
    }
    selectsDate = (e) => {
        console.log(e);
        this.setState({ sdate: e })

    }
    selecteDate = (e) => {
        console.log(e);
        this.setState({ edate: e })


    }

    //     this.state = { controlledDate: {} };
    //     this.handleChangeDate = this.handleChangeDate.bind(this);
    // }
    // handleChangeDate(event) {
    //     this.setState({
    //         selectDate: event,
    //     });
    // }




    componentDidMount = () => {
        
    };
    onsubmit = (e) => {
        var token = localStorage.getItem("token");
        if (token !== null || token !== undefined) {
            const myHeaders = new Headers()
            myHeaders.append("Authorization",
                "Bearer " + localStorage.getItem("token"))
            myHeaders.append("Content-Type", "application/json")
            var raw = JSON.stringify({
                "endDate": formatDate(this.state.edate),
                "startDate": formatDate(this.state.sdate),
                "userId": ""
            })
            //  {console.log(endDate,startDate)}



            var requestOptions = {
                method: "POST",
                headers: myHeaders,
                body: raw,
                redirect: "follow",
            };
            let transactionUrl = "https://uat.softmintdigital.com/reportservice/transaction/transactionreport?pageNo=0&pageSize=20";
            fetch(transactionUrl,
                requestOptions
            )
                .then((response) => response.json())
                .then((result) => {
                    // data = null;
                    // hello(JSON.parse(result));
                    //this.addList(JSON.parse(result))
                    //console.log(JSON.parse(result))
                    // $(document).ready(function () {
                    //     $('#dataTable').triggerHandler();
                    // });
                    for (let index = 0; index < result.report.length; index++) {
                        data.push(result.report[index]);
                        console.log(result.report[index], data);
                        this.render(result.report);
                    }

                })
                .catch((error) => console.log(error));

        } else {
            this.props.history.push("/auth/login")
        }
        //second code

        // let date = new Date(e);
        // var token = localStorage.getItem("token");
        // var userid = localStorage.getItem("userid");
        // var jsonObject = localStorage.getItem("object");
        // if (token !== null || token !== undefined) {
        //     const myHeaders = new Headers();
        //     myHeaders.append("Authorization",
        //         "Bearer " + token);
        //     myHeaders.append("Content-Type", "application/json");

        //     var raw = JSON.stringify({
        //         "endDate": formatDate(this.state.edate),
        //         "startDate": formatDate(this.state.sdate),
        //         "userId": userid

        //     });
        //     // {console.log(endDate,startDate)}



        //     var requestOptions = {
        //         method: "POST",
        //         headers: myHeaders,
        //         body: raw,
        //         redirect: "follow",
        //     };

        //     let transactionUrl = "https://uat.softmintdigital.com/reportservice/transaction/transactionreport?pageNo=0&pageSize=20";

        //     fetch(transactionUrl,
        //         requestOptions
        //     )
        //         .then((response) => response.text())

        //         .then((result) => {
        //             hello(JSON.parse(result))
        //             console.log(JSON.parse(result))
        //             // this.addList(JSON.parse(result))
        //                 //    console.log(JSON.parse(result))


        //         })
        //         .catch((error) => console.log(error));


        // } else {
        //     this.props.history.push("/auth/login")
        // }

        // console.log(formatDate(this.state.sdate), formatDate(this.state.edate));

    }

    addList = (response) => {
        const list = response.report;
        rows.length = 0;
        for (let i = 0; i < list.length; i++) {
            console.log("Itretion " + i + " Times");
            //    console.log(JSON.parse(response))
            var lst = list[i];
            rows.push(
                <tr>
                    <th scope="row">
                        <Media className="align-items-center">
                            <Media>
                                <span className="mb-0 text-sm">{i + 1}</span>
                            </Media>
                        </Media>
                    </th>
                    <td>{lst.name}</td>
                    <td>
                        <Badge color="" className="badge-dot mr-4">
                            <i className="bg-warning" />
                            {lst.firmName}
                        </Badge>
                    </td>

                    <td>
                        <div className="avatar-group">
                            <span className="mr-2">{lst.wlnm}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.wlId}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.userId}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.transId}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.openingBal}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.credit}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.debit}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.closingBal}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.narration}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.remarks}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.adopbal}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.adclbal}</span>
                        </div>
                    </td>
                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.date}</span>
                        </div>
                    </td>

                    <td>
                        <div className="d-flex align-items-center">
                            <span className="mr-2">{lst.time}</span>
                        </div>
                    </td>
                </tr>
            );
        }
        console.log(rows);
    };

    render() {

        return (
            <>
                <div className="header bg-gradient-info pb-8 pt-5 pt-md-8">
                    <Container fluid>
                        <div className="header-body">
                            <Row>
                                <Col lg="12" xl="12">
                                    <Card className="card-stats mb-4 mb-xl-0">
                                        <CardBody>
                                            <Row>
                                                <Col lg="2" md="6">
                                                    <h4>Start Date: </h4>
                                                    {/* <DatePicker className="form-control" hintText="Date" value={this.state.controlledDate} selected={this.state.date} onChange={this.handleChangeDate}/> */}
                                                    <DatePicker className="form-control" selected={this.state.sdate} onChange={this.selectsDate} placeholderText="Select Date" showPopperArrow={false} dateFormat="yyyy-MM-dd" onCh />
                                                    {/* <DatePicker className="form-control" selected={this.state.sdate} dateFormat="dd/MM/yyy"
                                                    onChange={this.selectDate}
                                                        placeholderText="DD-MM-YYYY"
                                                    /> */}


                                                </Col>
                                                <Col lg="2" md="6">
                                                    <h4>End Date: </h4>
                                                    <DatePicker className="form-control" selected={this.state.edate} dateFormat="yyyy-MM-dd" placeholderText="Select Date" showPopperArrow={false} onChange={this.selecteDate} />

                                                    {/* <DatePicker selected={this.state.edate} onChange={this.EndDate} dateFormat="dd/MM/yyy"
                                                     placeholderText="DD-MM-YYYY" /> */}
                                                </Col>
                                                <Col lg="2" md="6">
                                                    <h4>Search</h4>
                                                    <div>

                                                        <input
                                                            type="text"

                                                            className="form-control"
                                                            placeholder="Search"
                                                            style={{

                                                                marginBottom: "2px",
                                                            }}
                                                        ></input>
                                                    </div>
                                                </Col>
                                                <Col lg="2" md="6">
                                                    <button type="submit" className="btn btn-success"
                                                        style={{
                                                            backgroundColor: "#11cdef",
                                                            // height: "10px",
                                                            textAlign: "center",
                                                            display: "flex",
                                                            justifyContent: "center",
                                                            alignItems: "center",
                                                            marginTop: "30px",
                                                        }}
                                                        onClick={this.onsubmit}
                                                        // className="btn-icon-clipboard"
                                                        data-clipboard-text="align-center"
                                                        id="tooltip662352101"
                                                    // type="button"
                                                    >
                                                        UPDATE
                                                    </button>
                                                </Col>
                                                <Col lg="2" md="6">
                                                    <button type="submit" className="btn btn-success"
                                                        style={{
                                                            backgroundColor: "#11cdef",
                                                            // height: "10px",
                                                            textAlign: "center",
                                                            display: "flex",
                                                            justifyContent: "center",
                                                            alignItems: "center",
                                                            marginTop: "30px",
                                                        }}
                                                        // className="btn-icon-clipboard"
                                                        data-clipboard-text="align-center"
                                                        id="tooltip662352101"
                                                    // type="button"
                                                    >
                                                        Export
                                                    </button>
                                                </Col>
                                                <Col lg="2" md="6">
                                                    <button type="submit" className="btn btn-success"
                                                        style={{
                                                            backgroundColor: "#11cdef",
                                                            // height: "10px",
                                                            textAlign: "center",
                                                            display: "flex",
                                                            justifyContent: "center",
                                                            alignItems: "center",
                                                            marginTop: "30px",
                                                        }}
                                                        // className="btn-icon-clipboard"
                                                        data-clipboard-text="align-center"
                                                        id="tooltip662352101"
                                                    // type="button"
                                                    >
                                                        Export
                                                    </button>
                                                </Col>
                                            </Row>
                                            <p className="mt-3 mb-0 text-muted text-sm">
                                                <span className="text-success mr-2">

                                                </span>{" "}

                                            </p>
                                        </CardBody>
                                    </Card>
                                </Col>
                            </Row>
                        </div>
                    </Container>
                </div>

                <Container className="mt--7" fluid style={{ backgroundColor: "#" }}>
                    <Row className="mb--20">
                        <div className="col">
                            <Card className="shadow">
                                <CardHeader className=" border-0">
                                    <h3 className=" mb-0">Transiction Report</h3>
                                </CardHeader>
                                <Table className="align-items-center table-flush" responsive reflow="true" id="dataTable">
                                    <thead className="thead-light">
                                        <tr>
                                            <th scope="col">SR NO.</th>
                                            <th scope="col">name</th>
                                            <th scope="col"> firmName</th>
                                            <th scope="col">wlnm</th>
                                            <th scope="col">wlId</th>
                                            <th scope="col">userId</th>
                                            <th scope="col">transId</th>
                                            <th scope="col">openingBal</th>
                                            <th scope="col">credit</th>
                                            <th scope="col">debit</th>
                                            <th scope="col">closingBal</th>
                                            <th scope="col">narration</th>
                                            <th scope="col">remarks</th>
                                            <th scope="col">adopbal</th>
                                            <th scope="col">adclbal</th>
                                            <th scope="col">date</th>
                                            <th scope="col">time</th>

                                            <th scope="col" />
                                        </tr>
                                    </thead>
                                    <tbody>
                                        {data.map((result) => {
                                            return (
                                                <tr class="table-success">


                                                    <td>{result.name}</td>
                                                    <td>{result.email}</td>
                                                    <td>{result.username}</td>
                                                    <td>{result.date}</td>

                                                </tr>
                                            )
                                        })}
                                    </tbody>
                                    <div style={{
                                        display: 'block', width: 700, padding: 30
                                    }}>

                                    </div>
                                </Table>

                            </Card>


